        <!-- begin second stand out  -->
        <figure class=""stand_out"">

            <h3 class=""medium_heading""> II. OBJECTIFS PEDAGOGIQUES </h3>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 1. Origine du programme </h3>
                <p class=""description""> 
                    Dans une économie mondialisée, l’émergence des secteurs spécialisés a permis une séparation distincte des activités de l’entreprise. Les
                    informations et les connaissances étant alors de plus en plus spécialisées et fragmentées, leur production constitue une activité séparée des autres
                    activités de l’entreprise. L’économie de la connaissance va ainsi se focaliser sur la production de connaissances pour la compétitivité.
                    Pour ");
            WriteLiteral(@"maîtriser l’information, les entreprises doivent faire appel au cycle de l’information, qui est établi en trois étapes : tout d’abord, recueillir
                    des informations brutes, c’est-à-dire réaliser un travail de veille et de collecte d’informations, ensuite, créer des connaissances à partir de cette
                    information à l’aide de logiciels intelligents et de l’intelligence des Hommes, et enfin, restituer ces connaissances sous forme d’informations
                    stratégiques, ce cycle ne pouvant être mené qu’à travers des travaux d’intelligence économique.
                    La Licence Professionnelle « Intelligence économique et Management des Connaissances » est une formation qui s’étale sur une année et
                    s’adresse aux titulaires d’un diplôme en sciences, en économie, gestion et sciences de l’information de niveau bac+2. La formation est organisée
                    en deux semestres comportant chacun des enseignements sous forme de cours magistrau");
            WriteLiteral(@"x, de travaux dirigés et de travaux pratiques. Une partie
                    du second semestre est consacré exclusivement à un stage professionnel.
                </p>
            </div>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 2. Objectifs du programme </h3>
                <h3 class=""smaller_heading""> II.2.1. Objectif général </h3>
                <p class=""description""> 
                    L’objectif de cette filière est de former les étudiants à la gestion stratégique de l’information et la gestion des connaissances dans les entreprises
                    et les diverses organisations.	                    
                </p>

                <h3 class=""smaller_heading""> II.2.2. Objectifs spécifiques </h3>
                <p class=""description""> 
                    <strong> Commun à la mention </strong><br/>
                    Les étudiants de la Licence professionnelle en Intelligence Économique et Management des Connaissances, sont c");
            WriteLiteral(@"apables à l'issue de leur
                    formation de : <br/>
                </p>
                <ul class=""one_list"">
                    <li> Comprendre les besoins d'informations puis traduire ces besoins en une démarche construite de collecte, </li>
                    <li> Collecter et traiter l'information de façon pertinente, </li>
                    <li> Savoir identifier la désinformation et réagir aux rumeurs,</li>
                    <li> Traiter les problèmes de sécurité de l'information. </li>
                </ul>

                <h3 class=""small_heading""> II.3. Approche du programme </h3>
                <p class=""description""> 
                    Le programme prépare au parcours de Technicien Supérieur dans les entreprises ou administration et qui a pour but de préparer aux carrières
                    dans le secteur privé.
                </p>

            </div>

        </figure>

